🚨“NEW FAVORITE RESTAURANT!” 🚨

@okomegrill7777 is a new local restaurant featuring build-your-own style Asian bowls that are fresh, fast, & oh so delicious!! And did I mention you can get a bowl for only $10?! 🤯

Luke and I got the chance to go on a little date night last week and we were  absolutely blown away with our experience at Okome—so much so that it’s now Luke’s new favorite spot! 

@okomegrill7777 is peanut-free, gluten-free, vegan friendly, and focused on providing you with fresh, healthy, AND delicious food. Along with their yummy bowls, they even offer house made lemonades, and free chicken broth! 

Order online or grab a friend and enjoy one of my new favorite meals in Lexington! 😋

